// Simula una petición asincrónica
export const getVehiculos = () => {
  return new Promise((resolve,reject) => {
    setTimeout(() => {
      // Simulación de error, puedes definir 'error' como false si no lo necesitas
      const error = false;
      if(error) {
        reject('Error al obtener los vehículos');
      } else {    
        resolve(vehiculosMock);
      }
    }, 3000); // 3 segundos de demora simulada
  });
}